import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function JetTrackingPage() {
  const [jets, setJets] = useState([]);

  useEffect(() => {
    // Replace with the actual API endpoint and your API key
    const API_ENDPOINT = 'https://api.aviationstack.com/v1/flights';
    const API_KEY = '5b7409bc2ed7e040208cc26918a9e740';

    // Add your jets' tail numbers/registrations here
    const jetRegistrations = ['TAIL123', 'TAIL456', 'TAIL789'];

    jetRegistrations.forEach(registration => {
      axios.get(`${API_ENDPOINT}?access_key=${API_KEY}&flight_iata=${registration}`)
        .then(response => {
          // Assuming the API returns the flight status, update the state
          const jetStatus = {
            registration: registration,
            isAtDenver: response.data.data.some(flight => flight.arrival.airport === 'Denver International'),
          };
          setJets(prevJets => [...prevJets, jetStatus]);
        })
        .catch(error => {
          console.error('Error fetching data:', error);
        });
    });
  }, []);

  return (
    <div className="main-content">
      <h2>Jet Tracking</h2>
      <div className="jet-tracking-section">
        {jets.map(jet => (
          <p key={jet.registration}>
            {jet.registration}: {jet.isAtDenver ? 'Landed at Denver International Airport' : 'Not at Denver International Airport'}
          </p>
        ))}
      </div>
    </div>
  );
}

export default JetTrackingPage;
